--------------------------------------------------------
--  DDL for Sequence XDM_SEQ
--------------------------------------------------------

   CREATE SEQUENCE  "XDM_SEQ"  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1 START WITH 1 NOCACHE  NOORDER  NOCYCLE ;
--------------------------------------------------------
--  DDL for Table XDM_ELEMENTS
--------------------------------------------------------

  CREATE TABLE "XDM_ELEMENTS" 
   (	"ELEM_KEY" VARCHAR2(10 CHAR), 
	"SUPL_ID" NUMBER(12,0), 
	"DESCRIPTION" VARCHAR2(250 CHAR), 
	"MAX_PAX" NUMBER(5,0)
   ) ;
--------------------------------------------------------
--  DDL for Table XDM_PERSONS
--------------------------------------------------------

  CREATE TABLE "XDM_PERSONS" 
   (	"PERS_ID" NUMBER(12,0), 
	"INITIALS" VARCHAR2(5 CHAR), 
	"FIRST_NAME" VARCHAR2(80 CHAR), 
	"LAST_NAME" VARCHAR2(80 CHAR), 
	"PROGRAMME_MANAGER_YN" VARCHAR2(1)
   ) ;
--------------------------------------------------------
--  DDL for Table XDM_PROGRAMMES
--------------------------------------------------------

  CREATE TABLE "XDM_PROGRAMMES" 
   (	"PROG_ID" NUMBER(12,0), 
	"EV_KEY" VARCHAR2(30 CHAR), 
	"NAME" VARCHAR2(250 CHAR), 
	"OWNER" NUMBER(12,0)
   ) ;
--------------------------------------------------------
--  DDL for Table XDM_TASKS
--------------------------------------------------------

  CREATE TABLE "XDM_TASKS" 
   (	"TASK_ID" NUMBER(12,0), 
	"ELEM_KEY" VARCHAR2(10 CHAR), 
	"PROG_ID" NUMBER(12,0), 
	"START_DATE" DATE, 
	"START_WHERE" VARCHAR2(250 CHAR), 
	"TEXT" VARCHAR2(4000), 
	"END_DATE" DATE, 
	"END_WHERE" VARCHAR2(250 CHAR), 
	"PAX" NUMBER(5,0), 
	"REMARKS" VARCHAR2(4000), 
	"FLIGHT_NO" VARCHAR2(250), 
	"PERS_ID" NUMBER(12,0), 
	"CXL_YN" VARCHAR2(1 CHAR) DEFAULT 'N'
   ) ;

--------------------------------------------------------
--  Constraints for Table XDM_ELEMENTS
--------------------------------------------------------

  ALTER TABLE "XDM_ELEMENTS" MODIFY ("ELEM_KEY" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_ELEMENTS" ADD CONSTRAINT "XDM_ELEMENTS_PK" PRIMARY KEY ("ELEM_KEY") ENABLE;

--------------------------------------------------------
--  Constraints for Table XDM_PERSONS
--------------------------------------------------------

  ALTER TABLE "XDM_PERSONS" MODIFY ("INITIALS" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_PERSONS" MODIFY ("PERS_ID" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_PERSONS" ADD CONSTRAINT "XDM_PERSONS_PK" PRIMARY KEY ("PERS_ID") ENABLE;
 
  ALTER TABLE "XDM_PERSONS" ADD CONSTRAINT "XDM_PERS_INITIALS_UK" UNIQUE ("INITIALS") ENABLE;

--------------------------------------------------------
--  Constraints for Table XDM_PROGRAMMES
--------------------------------------------------------

  ALTER TABLE "XDM_PROGRAMMES" MODIFY ("PROG_ID" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_PROGRAMMES" ADD CONSTRAINT "XDM_PROGRAMMES_PK" PRIMARY KEY ("PROG_ID") ENABLE;

--------------------------------------------------------
--  Constraints for Table XDM_TASKS
--------------------------------------------------------

  ALTER TABLE "XDM_TASKS" MODIFY ("TASK_ID" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_TASKS" MODIFY ("START_DATE" NOT NULL ENABLE);
 
  ALTER TABLE "XDM_TASKS" ADD CONSTRAINT "XDM_TASKS_CXL_CHK" CHECK (CXL_YN IN ('Y', 'N')) ENABLE;
 
  ALTER TABLE "XDM_TASKS" ADD CONSTRAINT "XDM_TASKS_PK" PRIMARY KEY ("TASK_ID") ENABLE;


--------------------------------------------------------
--  Ref Constraints for Table XDM_PROGRAMMES
--------------------------------------------------------

  ALTER TABLE "XDM_PROGRAMMES" ADD CONSTRAINT "XDM_PROG_PERS_FK" FOREIGN KEY ("OWNER")
	  REFERENCES "XDM_PERSONS" ("PERS_ID") ENABLE;
--------------------------------------------------------
--  Ref Constraints for Table XDM_TASKS
--------------------------------------------------------

  ALTER TABLE "XDM_TASKS" ADD CONSTRAINT "XDM_ELEM_TASK_FK" FOREIGN KEY ("ELEM_KEY")
	  REFERENCES "XDM_ELEMENTS" ("ELEM_KEY") ENABLE;
 
  ALTER TABLE "XDM_TASKS" ADD CONSTRAINT "XDM_PERS_TASK_FK" FOREIGN KEY ("PERS_ID")
	  REFERENCES "XDM_PERSONS" ("PERS_ID") ENABLE;
 
  ALTER TABLE "XDM_TASKS" ADD CONSTRAINT "XDM_PROG_TASK_FK" FOREIGN KEY ("PROG_ID")
	  REFERENCES "XDM_PROGRAMMES" ("PROG_ID") ON DELETE CASCADE ENABLE;

