--------------------------------------------------------
--  DDL for Trigger XDM_PERSON_BIR
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "XDM_PERSON_BIR" before insert on XDM_PERSONS    for each row begin     if inserting then       if :NEW.PERS_ID is null then          select XDM_SEQ.nextval into :NEW.PERS_ID from dual;       end if;    end if; end;
/
ALTER TRIGGER "XDM_PERSON_BIR" ENABLE;
--------------------------------------------------------
--  DDL for Trigger XDM_PROGRAMMES_BIR
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "XDM_PROGRAMMES_BIR" before insert on XDM_PROGRAMMES    for each row begin     if inserting then       if :NEW.PROG_ID is null then          select XDM_SEQ.nextval into :NEW.PROG_ID from dual;       end if;    end if; end;
/
ALTER TRIGGER "XDM_PROGRAMMES_BIR" ENABLE;
